import { 
  BrowserRouter as Router, 
  Switch, 
  Route,} from "react-router-dom";

import Home from "./routes/Home";
import Detail from "./routes/Detail";


function App2(){
  return (
    <Router>
      <Switch>
        <Route path='/'>
          <Home/>
        </Route>
        <Route path='/movie'>
          <Detail/>
        </Route>
      </Switch>
    </Router>);
}

export default App2;
